import React, { useState } from "react";
import { Modal } from "atomize";

function NetflixModal({ isOpen, onClose }) {
  const [modal, showModal] = useState(false)


  return(
    <Modal
      isOpen={isOpen}
      onClose={onClose}
      rounded="sm"
      maxW="48rem"
    >

    </Modal>
  )
}

export default NetflixModal;
